[application]

name="PeaceMachineGun"
main_scene="res://title.scn"
icon="icon.png"
boot_logo=img(rgb, 0, 674, 501, )

[autoload]

global="res://global.gd"

[debug]

print_fps=false

[display]

orientation="landscape"
width=1920
height=1080
fullscreen=false
resizable=true

[input]

forward=[key(W)]
backward=[key(S)]
strafe_left=[key(A)]
strafe_right=[key(D)]
jump=[key(Space)]
reload_scene=[key(R)]
throw_weapon=[key(E)]
skip_level=[key(F12)]

[render]

shadows_enabled=true
